import * as React from "react";
import QuickSortQustions from "./QuickSortQuestions";
import QuickSortVisualizer from "./QuickSortVisualizer";

function PracticeSelect() {
  return (
    <div className="PracticeSelect">
      <header className="PracticeSelect-header">
        <h1>Please select the type of practice you want to engage in:</h1>
        <div className="selectionButtons">
          <a href="./QuickSort">
            <button>Click me!</button>
          </a>
        </div>
      </header>
    </div>
  );
}

export default PracticeSelect;
